import React from "react";
import "./Home.css";
import {Button} from 'react-bootstrap';
import socket from "../socket";

function handleClick(e) {
  e.preventDefault();

  socket.emit('createGame', 'nodata');

  socket.on('createGame',gamedata => {
    this.props.history.push('/table/'+gamedata.gameid);
  })

}

export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
        <h1>Neighborhood</h1>
        <p>Play game with friends even when they're not in the neighborhood.</p>
      </div>
      <Button block bssize="large" onClick={handleClick}>Start a Texas Hold'em Table</Button>
    </div>
  );
}
